const WorkoutDetails = ({workout}) => {
    return (
        <div className="workout-details">
            <h4>
                {workout.name}
            </h4>
            <p>
                <strong>
                    shortname
                </strong> {workout.shortname}
            </p>
            <p>
                <strong>
                    address
                </strong> {workout.address}
            </p>
            <p>
                <strong>
                    Number of Members
                </strong> {workout.number_of_members}
            </p>
            <p>{workout.createdAt}</p>
        </div>
    )
}

export default WorkoutDetails
